	<script>
		function onActionClick(event) {
			var action = event && event.target && event.target.dataset && event.target.dataset.action && JSON.parse(event.target.dataset.action);
			if (action) {
				switch (action.Type) {
					case "hyperlink": window.open(action.Target, "_blank"); break;
					case "bookmark": window.location.href = window.location.href.replace(window.location.hash, "") + "#" + action.Target; break;
				}
			}
		}
		document.addEventListener("click", onActionClick);
	</script>
	
